import React from 'react'

export default function Red() {
    const redStyle = {
      height: "250px",
      width: "250px",
      border: "1px solid red",
      backgroundColor: "red",
      display: "flex",
      justifyContent: "center",
      alignItems:'center'
    };
    const redinline ={
        height:'180px',
        width:'180px',
        backgroundColor: 'white',
    }
    return (
        <div style ={redStyle}>
            <div style={redinline}>
                <div>
                    
                </div>
            </div>
        </div>
    )
}
